Als Lucy en de knappe countryzanger Nick elkaar ontmoeten, worden ze smoorverliefd en niets lijkt een gelukkige relatie in de weg te staan. Maar dan slaat het noodlot toe Een heerlijke liefdesroman van topschrijfster Wilma Hollander die zich afspeelt in het ruige en romantische Ierland. &quot;Wilma schrijft boeken waar je heerlijk bij kunt wegdromen!&quot; Whoopsie Daisy.nl 


